import React, { Component } from 'react'
import { Button, Container, Divall, FlexContainer, InputSearch } from './Todo'

export default class extends Component {
  constructor(props) {
    super(props)
    this.state = {
      data: [],
      modal: false,
      Firstname: "",
      Lastname: "",
      Address: "",
      seleted: null,
      firsname2: '',
      lastname2: '',
      address2: '',
      searchuser2: '',
    }
  }
  onChangeAll2(e) {
    this.setState({[e.target.name]:e.teeget.value})
  }

  onChangeAll(e) {
    this.setState({ [e.target.name]: e.target.value })

  }
  addUser() {
    this.setState({
      data: [
        ...this.state.data,
        {
          id: this.state.data.length + 1,
          Firstname: this.state.Firstname,
          Lastname: this.state.Lastname,
          Address: this.state.Address,
        }
      ],
      modal: !this.state.modal,
      Firstname: "",
      Lastname: "",
      Address: "",
    })
  }
  editUser(value) {
    this.setState({ seleted: value.id ,
    firsname2:value.Firstname,
    lastname2: value.Lastname,
   address2: value.A,
    })
  }
  seveUser() {
    this.setState({
      data: this.state.data.map((value) => 
        this.state.seleted === value.id ? {
          firsname2: this.state.Firstname,
          lastname2: this.state.Lastname,
          address2: this.state.Address,

        }:value
)})
  }
  render() {
    const { Firstname, Lastname, Address, data, firsname2, lastname2, address2 } = this.state;
    console.log(firsname2, lastname2, address2, data);
    return (
      <Container>
        <FlexContainer>
          <InputSearch type={'text'} placeholder={'Search'} widthh />
          {this.state.modal === true ? <Button onClick={() => this.addUser()}>Add User</Button> :
            <Button onClick={() => this.setState({ modal: !this.state.modal })}> + New User
            </Button>}
        </FlexContainer>
        <Divall open={this.state.modal}>
          {this.state.modal === true && <FlexContainer >
            <InputSearch placeholder='Firstname' name='Firstname' value={this.state.Firstname}
              onChange={(e) => this.onChangeAll2(e)} />
            <InputSearch placeholder='Lastname' name='Lastname' value={this.state.Lastname} widthh
              onChange={(e) => this.onChangeAll2(e)} />
            <InputSearch placeholder='Address' name='Address' value={this.state.Address}
              onChange={(e) => this.onChangeAll2(e)} />
          </FlexContainer>}
        </Divall>
        <table border={1} style={{ borderCollapse: 'collapse' }}>
          <thead>
            <tr>
              <th>Firstname </th>
              <th>Lastname </th>
              <th>Addres</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            {this.state.data.map((value) => (
              <tr>
                {this.state.seleted === value.id ?
                  <>
                    <td><InputSearch /></td>
                    <td><InputSearch /></td>
                    <td><InputSearch /></td>
                  </>
                  :
                  <>
                    <td>{value.Firstname}</td>
                    <td>{value.Lastname}</td>
                    <td>{value.Address}</td>
                  </>}

                <td>   <Button rang='red  ' back='white' borderr='red'
                  onClick={() => this.setState({ data: this.state.data.filter((val) => val.id !== value.id) })}>Delete</Button>
                  {this.state.seleted === value.id ? (
                    <Button rang='green' back='white ' borderr='green' onClick={() => this.seveUser()} >Save</Button>) : (
                    <Button rang='orange' back='white ' borderr='orange' onClick={() => this.editUser(value)}>Edit</Button>
                  )}
                </td>
              </tr>
            ))}


          </tbody>
        </table>
      </Container>
    )
  }
}
